import React from 'react';
import "./Header.css";

function Header() {
    return 
    <nav className="navbar navbar-light navbar-expand-md sticky-top navigation-clean-button" style="height: 80px;background-color: #37434d;color: #ffffff;">
        <div className="container-fluid"><a className="navbar-brand" href="#"><i className="fa fa-globe"></i> Antariksh</a><button className="navbar-toggler" data-bs-toggle="collapse" data-bs-target="#navcol-1"><span className="visually-hidden">Toggle navigation</span><span className="navbar-toggler-icon"></span></button>
            <div id="navcol-1" className="collapse navbar-collapse">
                <ul className="navbar-nav ms-auto">
                    <li className="nav-item"><a className="nav-link active" style="color: #ffffff;" href="#"><i className="fa fa-home"></i> Home</a></li>
                    <li className="nav-item"><a className="nav-link active" style="color: #ffffff;" href="#"><i className="fa fa-wpexplorer"></i> Explore</a></li>
                    <li className="nav-item"><a className="nav-link active" style="color: #ffffff;" href="#"><i className="fa fa-star-o"></i> Features</a></li>
                    <li className="nav-item"><a className="nav-link active" style="color: #ffffff;" href="#"><i className="fa fa-user-circle-o"></i> Portfolio</a></li>
                    <li className="nav-item"><a className="nav-link active" style="color: #ffffff;" href="#"><i className="fa fa-sign-in"></i> Sign In</a></li>
                </ul>
            </div>
        </div>
    </nav>;
}

export default Header;
